import linkedin from './../../images/ic-navbar-linkedin.svg';
//Icons
import { Icon } from 'react-icons-kit';
import { globe } from 'react-icons-kit/feather/globe';

import './style.scss';
import BurgerMenu from './BurgerMenu';

